jQuery,
    (showSwal = function (type) {
        "use strict";
        "basic" === type
            ? swal({
                  text: "Any fool can use a computer",
                  button: {
                      text: "OK",
                      value: !0,
                      visible: !0,
                      className: "btn btn-primary",
                  },
              })
            : "title-and-text" === type
            ? swal({
                  title: "Read the alert!",
                  text: "Click OK to close this alert",
                  button: {
                      text: "OK",
                      value: !0,
                      visible: !0,
                      className: "btn btn-primary",
                  },
              })
            : "success-message" === type
            ? swal({
                  title: "Congratulations!",
                  text: "You entered the correct answer",
                  icon: "success",
                  button: {
                      text: "Continue",
                      value: !0,
                      visible: !0,
                      className: "btn btn-primary",
                  },
              })
            : "auto-close" === type
            ? swal({
                  title: "Auto close alert!",
                  text: "I will close in 2 seconds.",
                  timer: 2e3,
                  button: !1,
              }).then(
                  function () {},
                  function (dismiss) {
                      "timer" === dismiss &&
                          console.log("I was closed by the timer");
                  }
              )
            : "warning-message-and-cancel" === type
            ? swal({
                  title: "Are you sure?",
                  text: "You won't be able to revert this!",
                  icon: "warning",
                  showCancelButton: !0,
                  confirmButtonColor: "#3f51b5",
                  cancelButtonColor: "#ff4081",
                  confirmButtonText: "Great ",
                  buttons: {
                      cancel: {
                          text: "Cancel",
                          value: null,
                          visible: !0,
                          className: "btn btn-danger",
                          closeModal: !0,
                      },
                      confirm: {
                          text: "OK",
                          value: !0,
                          visible: !0,
                          className: "btn btn-primary",
                          closeModal: !0,
                      },
                  },
              })
            : "custom-html" === type &&
              swal({
                  content: {
                      element: "input",
                      attributes: {
                          placeholder: "Type your password",
                          type: "password",
                          class: "form-control",
                      },
                  },
                  button: {
                      text: "OK",
                      value: !0,
                      visible: !0,
                      className: "btn btn-primary",
                  },
              });
    });
